import React from 'react';
//import logo from './logo.svg';
import './App.css';
import Header from "./Header"
import Body from "./Body"
import Footer from "./Footer"


function App() {
  return (
    <div style={{background_image: "/images/background.jpg"}}>
        <Header />
        <Body />
        <Footer />
    </div>
  )
}

export default App;
